"use strict";

var icoBtn = "data:image/png;base64,";

var icoBack = "data:image/png;base64,";

var icoLogin = "data:image/png;base64,";

var currentCategory;

var selected;

var data = [];

var dataById = {};

var dataByCategory = {};

var ip_address;

function __$(id) {
    return document.getElementById(id);
}

function expandViewer(category) {

    if (!category)
        return;

    currentCategory = category;

    if (__$("newsBanner")) {

        __$("newsBanner").style.height = "99.5%";

        showHeadlines(category);

        if (__$("btnHome")) {

            document.body.removeChild(__$("btnHome"));

        }

        if (__$("btnBack")) {

            document.body.removeChild(__$("btnBack"));

        }

        if (__$("btnLogin")) {

            document.body.removeChild(__$("btnLogin"));

        }

        var btnHome = document.createElement("img");
        btnHome.setAttribute("src", icoBtn);
        btnHome.style.position = "absolute";
        btnHome.style.right = "20px";
        btnHome.style.bottom = "20px";
        btnHome.style.zIndex = 2010;
        btnHome.style.cursor = "pointer";
        btnHome.setAttribute("height", 80);
        btnHome.id = "btnHome";

        btnHome.onmousedown = function () {

            createBanner();

        }

        document.body.appendChild(btnHome);

        var btnLogin = document.createElement("img");
        btnLogin.setAttribute("src", icoLogin);
        btnLogin.style.position = "absolute";
        btnLogin.style.right = "120px";
        btnLogin.style.bottom = "20px";
        btnLogin.style.zIndex = 2010;
        btnLogin.style.cursor = "pointer";
        btnLogin.setAttribute("height", 70);
        btnLogin.id = "btnLogin";

        btnLogin.onmousedown = function () {

            shrinkViewer();

        }

        document.body.appendChild(btnLogin);

    }

}

function shrinkViewer() {

    if (__$("btnHome")) {

        document.body.removeChild(__$("btnHome"));

    }

    if (__$("btnBack")) {

        document.body.removeChild(__$("btnBack"));

    }

    if (__$("btnLogin")) {

        document.body.removeChild(__$("btnLogin"));

    }

    flipHeadlines();

    if (__$("newsBanner")) {

        __$("newsBanner").style.height = "70px";

    }

}

function navBack() {

    if (__$("btnBack")) {

        document.body.removeChild(__$("btnBack"));

    }

    showHeadlines(currentCategory);
}

function showBackButton() {

    var btnBack = document.createElement("img");
    btnBack.setAttribute("src", icoBack);
    btnBack.style.position = "absolute";
    btnBack.style.right = "210px";
    btnBack.style.bottom = "20px";
    btnBack.style.zIndex = 2010;
    btnBack.style.cursor = "pointer";
    btnBack.setAttribute("height", 70);
    btnBack.id = "btnBack";

    btnBack.onmousedown = function () {

        navBack();

    }

    document.body.appendChild(btnBack);

}

function createBanner() {

    if (__$("btnHome")) {

        document.body.removeChild(__$("btnHome"));

    }

    if (__$("btnBack")) {

        document.body.removeChild(__$("btnBack"));

    }

    if (__$("btnLogin")) {

        document.body.removeChild(__$("btnLogin"));

    }

    if (__$("newsBanner")) {

        document.body.removeChild(__$("newsBanner"));

    }

    var banner = document.createElement("div");
    banner.style.border = "1px solid rgba(204,204,204,1)";
    banner.style.position = "absolute";
    banner.style.zIndex = 2000;
    banner.style.height = "99.5%";
    banner.style.top = "0px";
    banner.style.left = "0px";
    banner.style.width = "99.9%";
    banner.style.overflow = "hidden";
    banner.id = "newsBanner";

    document.body.appendChild(banner);

    var iframe = document.createElement("iframe");
    iframe.style.border = "1px solid #000";
    iframe.style.width = "100%";
    iframe.style.height = "100%";
    iframe.style.backgroundColor = "#fff";
    iframe.id = "iframe";

    // #333 => rgba(51,51,51,1)
    // #eee => rgba(238,238,238,1)
    // #999 => rgba(153,153,153,1)
    // #ccc => rgba(204,204,204,1)

    var html = "<body><style>.news {background-color: red; color: white; padding: 30px; font-size: 32px; cursor: pointer; " +
        "width: 200px; text-align: center; border: 2px outset red;} .sports {background-color: blue; color: white; padding: 30px; " +
        "font-size: 32px; cursor: pointer; width: 200px; text-align: center; border: 2px outset blue;}</style>" +
        "<table style='margin: auto; margin-top: 200px;' cellpadding='20'><tr><td><div class='news' onclick='window.parent.expandViewer(\"news\");'>News</div></td></tr>" +
        "<tr><td><div class='sports' onclick='window.parent.expandViewer(\"sports\");'>Sports</div></td></tr></table></body>";

    iframe.src = 'data:text/html;charset=utf-8,' + encodeURI(html);

    banner.appendChild(iframe);

    var btnLogin = document.createElement("img");
    btnLogin.setAttribute("src", icoLogin);
    btnLogin.style.position = "absolute";
    btnLogin.style.right = "20px";
    btnLogin.style.bottom = "20px";
    btnLogin.style.zIndex = 2010;
    btnLogin.style.cursor = "pointer";
    btnLogin.setAttribute("height", 70);
    btnLogin.id = "btnLogin";

    btnLogin.onmousedown = function () {

        shrinkViewer();

    }

    document.body.appendChild(btnLogin);

}

function showHeadlines(category) {

    var html = "<body onresize='window.parent.resize()'><style>body{margin:0px;font:14px'LucidaGrande',Helvetica,Arial,sans-serif;-moz-user-select:none;" +
        "color:rgba(51,51,51,1);}.active{background-color:rgba(51,51,51,1);color:rgba(238,238,238,1);}.inactive{" +
        "background-color:rgba(255,255,255,1);color:rgba(51,51,51,1);cursor:pointer;}li{cursor:pointer;}li:hover{" +
        "background-color:rgba(238,238,238,1);}</style>";

    html += "<table style='width: 100%; border-collapse: collapse; border: 1px solid rgba(153,153,153,1);' cellspacing=0 " +
        "cellpadding=0 border=1><tr><th style='width: 50%; padding: 10px; cursor: pointer; font-size: 28px;' id='news' " +
        "onmousedown='window.parent.switchTab(this);'>NEWS</th><th style='width: 50%; padding: 10px; cursor: pointer; font-size: 28px;' " +
        "id='sports' onmousedown='window.parent.switchTab(this);'>SPORTS</th></tr><tr><td colspan='2'><div id='mainContent' " +
        "style='width: 100%; border: none;'></div></td></tr>";

    html += "<script>if(document.getElementById('" + category.trim().toLowerCase() +
        "')){window.parent.switchTab(document.getElementById('" + category.trim().toLowerCase() + "'));} window.parent.resize();</script></body>";

    var page = 'data:text/html;charset=utf-8,' + encodeURI(html);

    if (__$("iframe")) {

        __$("iframe").setAttribute("src", page);

    }

}

function ____$(id) {
    return __$("iframe").contentWindow.document.getElementById(id);
}

function resize() {
    if (____$("mainContent")) {
        ____$("mainContent").style.height = (window.innerHeight - 65) + "px";
    }
}

function switchTab(tab) {
    if (!tab)
        return;

    if (selected) {
        selected.className = "inactive";
    }

    selected = tab;

    currentCategory = selected.innerHTML.trim().toLowerCase();

    loadPage();

    selected.className = "active";
}

function ajaxNewsFeed() {
    var httpRequest = new XMLHttpRequest();
    httpRequest.onreadystatechange = function () {
        if (httpRequest.readyState == 4 && httpRequest.status == 200) {
            dataById = JSON.parse(httpRequest.responseText);

            ip_address = dataById.ip_address;

            console.log(ip_address);

            delete dataById.ip_address;

            var keys = Object.keys(dataById);

            data = [];

            dataByCategory = {};

            for(var i = 0; i < keys.length; i++) {

                data.push(dataById[keys[i]]);

                if(!dataByCategory[dataById[keys[i]].category.trim().toLowerCase()]) {

                    dataByCategory[dataById[keys[i]].category.trim().toLowerCase()] = [];

                }

                dataByCategory[dataById[keys[i]].category.trim().toLowerCase()].push(dataById[keys[i]]);

            }

            loadPage();
        }
    };
    try {
        httpRequest.open('GET', "/query", true);
        httpRequest.send(null);
    } catch (e) {
    }
}

function loadPage() {

    if (____$("mainContent")) {

        ____$("mainContent").innerHTML = "";

        var ul = document.createElement("ul");
        ul.style.padding = "0px";
        ul.style.listStyle = "none";
        ul.style.width = "100%";
        ul.style.margin = "0px";

        ____$("mainContent").appendChild(ul);

        for (var i = 0; i < dataByCategory[currentCategory].length; i++) {

            var li = document.createElement("li");
            li.style.padding = "20px";
            li.style.fontSize = "24px";
            li.style.borderBottom = "1px dotted rgba(204,204,204,1)";
            li.innerHTML = dataByCategory[currentCategory][i].title;
            li.setAttribute("path", dataByCategory[currentCategory][i].id);

            li.onmousedown = function () {

                if (__$("iframe")) {

                    showArticle(this.getAttribute("path"));

                    window.parent.showBackButton();

                }

            }

            ul.appendChild(li);

        }

    }

}

function showArticle(id) {

    var doc = dataById[id];

    if (!doc)
        return;

    var html = "<body><style>body{margin:0px;font:14px'LucidaGrande',Helvetica,Arial,sans-serif;-moz-user-select:none;color:rgba(51,51,51,1);}</style>";

    var months = ["Jan", "Feb", "Mar", "Apr", "May", "Jun", "Jul", "Aug", "Sep", "Oct", "Nov", "Dec"];
    var date = new Date(parseInt(doc.datetime));
    var published = date.getDate() + "/" + months[date.getMonth()] + "/" + date.getFullYear();

    html += "<table style='width: 100%;' cellpadding=10 ><tr><th style='text-align: left; font-size: 24px;' >" +
        doc.title + "</th><td align='right'>" + published + "</td></tr><tr><td colspan='2' style='border-top: 1px solid rgba(204,204,204,1); font-size: 22px;'>" +
        doc.body + "</td></tr></table></body>";

    var page = 'data:text/html;charset=utf-8,' + encodeURI(html);

    if (__$("iframe")) {

        __$("iframe").setAttribute("src", page);

    }

}

function flipHeadlines() {

    var html = "<body><style>body{margin:0px;font:14px'LucidaGrande',Helvetica,Arial,sans-serif;-moz-user-select:none;" +
        "overflow:hidden;}.news{background-color:red;}.sports{background-color:blue;}.none{background-color:black;}</style>";

    html += "<div style='width: 100%; height: 70px; overflow: hidden; border: 1px solid black; text-align: center; vertical-align: " +
        "middle; cursor: pointer;' id='mainLink'><table width='100%' style='border-collapse: collapse;' cellpadding=15 " +
        "cellspacing=0 border=1><tr><th style='color: white; font-size: 32px; width: 140px; font-style: italic;' " +
        "id='category' class='none'>&nbsp;</th><td style='font-size: 28px;' id='body'><b>Loading:</b> ..please wait...</td></tr></table></div></body>";

    var page = 'data:text/html;charset=utf-8,' + encodeURI(html);

    if (__$("iframe")) {

        __$("iframe").setAttribute("src", page);

    }

}

function flipNews() {

    var pos = Math.round(Math.random() * data.length - 1);

    pos = (pos > data.length ? pos - 1 : pos);

    if((pos > 0 && !data[pos]) || pos < 0) {

        pos = 0;

    }

    if(____$("category") && ____$("body") && ____$("mainLink")) {

        if(data[pos]) {

            ____$("category").innerHTML = data[pos].category;

            ____$("category").className = data[pos].category.trim().toLowerCase();

            ____$("body").innerHTML = "<b>" + data[pos].title + "</b> "; // + data[pos].body;

            ____$("mainLink").setAttribute("category", data[pos].category.trim().toLowerCase());

            ____$("mainLink").onmousedown = function() {

                console.log(this.getAttribute("category"));

                window.parent.expandViewer(this.getAttribute("category"));

            }

        } else {

            ____$("category").innerHTML = "&nbsp;";

            ____$("category").className = "none";

            ____$("body").innerHTML = "<b>No news available:</b> News currently not available";

        }

    }

}

setInterval(function() {

    flipNews();

}, 2000);

(function () {

    function init() {

        ajaxNewsFeed();

        createBanner();

    }

    function __$(id) {
        return document.getElementById(id);
    }

    // Run app
    init();

})();